import { Box, Grid, Typography } from "@mui/material";

const Main = () => {
  return (
    <Grid container>
      <Grid item>
        <Box>
          <img alt="product-image" src="product-image.png" />
        </Box>
      </Grid>
      <Grid item>
        <Typography>
          ONE TIME ONLY special price for 6 extra Clarifion for only $14 each
          ($84.00 total!)
        </Typography>
      </Grid>
    </Grid>
  );
};

export default Main;
